import React from 'react';
import '../styles/News.css'; // Adjust the import path to reflect your folder structure

const News = () => {
    return (
        <div className="news-container">
            <div className="news">
                <img src="https://via.placeholder.com/150" alt="News 1" />
                <h2>All India Political Party Meet (AIPPM)</h2>
                <p>For emerging leaders, the All India Political Party Meet (AIPPM) renders a vibrant platform. It encourages thought-provoking discussions and productive debates on important subjects like as the conflict in Kashmir, freedom of expression, sedition laws, and indigenous rights. AIPPM promotes the growth of three important abilities: conflict resolution, effective communication, and critical thinking. Transform into a knowledgeable, sympathetic, and intelligent leader influencing India's destiny..</p>
            </div>
            <div className="news">
                <img src="https://via.placeholder.com/150" alt="News 2" />
                <h2>News 2</h2>
                <p>This is some text for news 2.</p>
            </div>
            <div className="news">
                <img src="https://via.placeholder.com/150" alt="News 3" />
                <h2>News 3</h2>
                <p>This is some text for news 3.</p>
            </div>
        </div>
    );
};

export default News;
